import React from "react";
import NewExpense from "./components/NewExpense/NewExpense";

import Expenses from "./components/Expenses/Expenses";

const App = () => {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const items = [
    {
      name: "snack",
      price: 4000,
      id: "1",
    },
    {
      name: "bowl",
      price: 10000,
      id: "1",
    },
    {
      name: "ice cream",
      price: 400,
      id: "2",
    },
    {
      name: "meat",
      price: 9800,
      id: "2",
    },
  ];

  const totalPrice = items.reduce((totalPrice, item) => {
    totalPrice[item.id] = totalPrice[item.id] || [];
    totalPrice[item.id].push(item);
    return totalPrice;
  });
  console.log("reduce", totalPrice);
  return (
    <div>
      <NewExpense />
      <Expenses items={expenses} />
    </div>
  );
};

export default App;
